import React, { FC } from 'react';
import styles from './Dessert.module.scss';

interface DessertProps {
  name:string;
  price:number;
}

const Dessert: FC<DessertProps> = ({name,price}) => (
  <div className={styles.Dessert}>

    <span>Name: {name} </span>
    <span>Price: {price}</span>

  </div>
);

export default Dessert;
